import React from 'react';
import ALL_PRODUCT_DATA from '../collection-preview/ALL_PRODUCT_DATA';
import ShopAllCardDetail from './Shop-all-card.component';


import './Shop-all-product.style.css';

class ShopAllProducts extends React.Component {
    constructor () {
        super();

        this.state = {
            shopAllCollections: ALL_PRODUCT_DATA
        }
    }

    render() {

        const {shopAllCollections} = this.state;
        return(
            <div className="shop-all-page-overview">
                {
                    shopAllCollections.map( ({id, ...otherCollectionsProps}) => (
                        <ShopAllCardDetail key={id} {...otherCollectionsProps}/>
                    ))
                }

            </div>
        )
    }
}

export default ShopAllProducts;
